import { NextPage } from 'next';
import Head from 'next/head';
import { useRouter } from 'next/router';
import { FaGithub, FaGitlab, FaBitbucket } from 'react-icons/fa';
import { Block } from 'baseui/block';
import { Button } from 'baseui/button';
import Container from '../components/UiElements/Container/Container';

const Login: NextPage<{}> = () => {
  const router = useRouter();

  return (
    <>
      <Head>
        <title>Login | INST.</title>
        <meta name="Description" content="Inst login page" />
      </Head>

      <Container>
        <Block
          overrides={{
            Block: {
              style: {
                minHeight: 'calc(100vh - 213px)',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                justifyContent: 'center',
              },
            },
          }}
        >
          <Block
            as="h1"
            overrides={{
              Block: {
                style: ({ $theme }) => {
                  return {
                    ...$theme.typography.font1250,
                    fontWeight: 700,
                    marginBottom: '30px',
                  };
                },
              },
            }}
          >
            Log in to INST.
          </Block>

          <Button
            onClick={() => router.push('/')}
            startEnhancer={() => <FaGithub size="1rem" />}
            overrides={{
              BaseButton: {
                style: ({ $theme }) => {
                  return {
                    ...$theme.typography.font250,
                    width: '100%',
                    maxWidth: '260px',
                    borderTopLeftRadius: '4px',
                    borderTopRightRadius: '4px',
                    borderBottomLeftRadius: '4px',
                    borderBottomRightRadius: '4px',
                    marginTop: '10px',
                    justifyContent: 'flex-start',
                    paddingLeft: '25px',
                    paddingRight: '25px',
                  };
                },
              },
            }}
          >
            Continue with GitHub
          </Button>

          <Button
            onClick={() => router.push('/')}
            startEnhancer={() => <FaGitlab size="1rem" />}
            overrides={{
              BaseButton: {
                style: ({ $theme }) => {
                  return {
                    ...$theme.typography.font250,
                    backgroundColor: $theme.colors.accent,
                    width: '100%',
                    maxWidth: '260px',
                    borderTopLeftRadius: '4px',
                    borderTopRightRadius: '4px',
                    borderBottomLeftRadius: '4px',
                    borderBottomRightRadius: '4px',
                    marginTop: '10px',
                    justifyContent: 'flex-start',
                    paddingLeft: '25px',
                    paddingRight: '25px',
                    ':hover': {
                      opacity: 0.85,
                    },
                  };
                },
              },
            }}
          >
            Continue with GitLab
          </Button>

          <Button
            onClick={() => router.push('/')}
            startEnhancer={() => <FaBitbucket size="1rem" />}
            overrides={{
              BaseButton: {
                style: ({ $theme }) => {
                  return {
                    ...$theme.typography.font250,
                    backgroundColor: $theme.colors.accent,
                    width: '100%',
                    maxWidth: '260px',
                    borderTopLeftRadius: '4px',
                    borderTopRightRadius: '4px',
                    borderBottomLeftRadius: '4px',
                    borderBottomRightRadius: '4px',
                    marginTop: '10px',
                    justifyContent: 'flex-start',
                    paddingLeft: '25px',
                    paddingRight: '25px',
                    ':hover': {
                      opacity: 0.85,
                    },
                  };
                },
              },
            }}
          >
            Continue with Bitbucket
          </Button>
        </Block>
      </Container>
    </>
  );
};

export default Login;
